import React, {Component} from 'react'
class ProcessLog extends Component{
  render(){
    if (this.props.data){
      console.log("ok true--logs");
      var logs = this.props.data.map(function(logs){
        return <div>{logs}</div>
      })

    }
    return(
      <section id='processlog'>
      <div>{logs}</div>
      </section>
    );
  }
}
export default ProcessLog
